$(document).ready(function(){$("#searchPhone").autocomplete({source:function(e,a){$.ajax({url:BASE_URL+"home/autocompletePhone",data:{searchText:e.term,maxResults:7},dataType:"json",success:function(e){a($.map(e,function(e){return{id:e.id,image:e.image,DeviceName:e.DeviceName}}))}})},select:function(e,a){return window.location=BASE_URL+"home/detail/"+a.item.id,!1}}).data("ui-autocomplete")._renderItem=function(e,a){return $(e).addClass("customSuggestList"),$("<li>").append('<a><img src="'+a.image+'"><span class="device_name">'+a.DeviceName+"</span></a>").appendTo(e)},$(".tr-menu").click(function(){return"none"==$(".cat-menu").css("display")||""==$(".cat-menu").css("display")?$(".cat-menu").css({display:"block"}):$(".cat-menu").css({display:"none"}),!1})});